import React from 'react';
import Button from '@material-ui/core/Button';


const Generate = ({save}) => {

    const generate = (e) => {
        e.preventDefault();
        save();
    }
    return(

            <Button color="primary" onClick={generate}>Generate New Quote</Button>
    )
}

export default Generate;
